        fetch("/api").then(response => {
          if(response.status === 200) {
            return response.json()
          }
        }).then(data => setMessage(data))
        .then(error => console.log(error))
      })

      return (
        <header class="App-header">
            <h1>sup</h1>
            <div>{
                message.status === 200 ? 
                <h3>{message.data.message}</h3>
                : <h3>LOADING</h3>}
            </div>
        </header>
      );

}
